// string","    #include \u003cvector\u003e // vector","","    // #include \u003cnlohmann/detail/abi_macros.hpp\u003e","","","    /*!","    @brief namespace for Niels Lohmann","    @see https://github.com/nlohmann","    @since version 1.0.0","    */","    NLOHMANN_JSON_NAMESPACE_BEGIN","","    /*!","    @brief default JSONSerializer template argument","","    This serializer ignores the template arguments and uses ADL","    ([argument-dependent lookup](https://en.cppreference.com/w/cpp/language/adl))","    for serialization.","    */","    template\u003ctypename T = void, typename SFINAE = void\u003e","    struct adl_serializer;","","    /// a class to store JSON values","    /// @sa https://json.nlohmann.me/api/basic_json/","    template\u003ctemplate\u003ctypename U, typename V, typename... Args\u003e class ObjectType =","    std::map,","    template\u003ctypename U, typename... Args\u003e class ArrayType = std::vector,","    class StringType = std::string, class BooleanType = bool,","    class NumberIntegerType = std::int64_t,","    class NumberUnsignedType = std::uint64_t,","    class NumberFloatType = double,","    template\u003ctypename U\u003e class AllocatorType = std::allocator,","    template\u003ctypename T, typename SFINAE = void\u003e class JSONSerializer =","    adl_serializer,","    class BinaryType = std::vector\u003cstd::uint8_t\u003e, // cppcheck-suppress syntaxError","    class CustomBaseClass = void\u003e","    class basic_json;","","    /// @brief JSON Pointer defines a string syntax for identifying a specific value within a JSON document","    /// @sa https://json.nlohmann.me/api/json_pointer/","    template\u003ctypename RefStringType\u003e","    class json_pointer;","","    /*!","    @brief default specialization","    @sa https://json.nlohmann.me/api/json/","    */","    using json = basic_json\u003c\u003e;","","    /// @brief a minimal map-like container that preserves insertion order","    /// @sa https://json.nlohmann.me/api/ordered_map/"