   // superficial check for the LegacyBidirectionalIterator named requirement","    static_assert(std::is_base_of\u003cstd::bidirectional_iterator_tag, std::bidirectional_iterator_tag\u003e::value","                  \u0026\u0026  std::is_base_of\u003cstd::bidirectional_iterator_tag, typename std::iterator_traits\u003ctypename array_t::iterator\u003e::iterator_category\u003e::value,","                  \"basic_json iterator assumes array and object type iterators satisfy the LegacyBidirectionalIterator named requirement.\");","","  public:","    /// The std::iterator class template (used as a base class to provide typedefs) is deprecated in C++17.","    /// The C++ Standard has never required user-defined iterators to derive from std::iterator.","    /// A user-defined iterator should provide publicly accessible typedefs named","    /// iterator_category, value_type, difference_type, pointer, and reference.","    /// Note that value_type is required to be non-const, even for constant iterators.","    using iterator_category = std::bidirectional_iterator_tag;","","    /// the type of the values when the iterator is dereferenced","    using value_type = typename BasicJsonType::value_type;","    /// a type to represent differences between iterators","    using difference_type = typename BasicJsonType::difference_type;","    /// defines a pointer to the type iterated over (value_type)","    using pointer = typename std::conditional\u003cstd::is_const\u003cBasicJsonType\u003e::value,","          typename BasicJsonType::const_pointer,","          typename BasicJsonType::pointer\u003e::type;","    /// defines a reference to the type iterated over (value_type)","    using reference =","        typename std::conditional\u003cstd::is_const\u003cBasicJsonType\u003e::value,","        typename BasicJsonType::const_reference,","        typename BasicJsonType::reference\u003e::type;","","    iter_impl() = default;","    ~iter_impl() = default;","    iter_impl(iter_impl\u0026\u0026